import * as Types from "./acctionTypes";

export const actFetchData = (data) => {
  return {
    type: Types.FETCH_DATA,
    data,
  };
};
export const actDeleteData = (id) => {
  return {
    type: Types.DELETE_DATA,
    id,
  };
};
export const actAddCount = (id) => {
  return {
    type: Types.ADD_COUNT,
    id,
  };
};
